    def format_cookie(self,cookie):
        split_cookie = cookie.split(';')
        cookie_info = {}
        for content in split_cookie:
            key = content.split('=')[0]
            value = unquote(content.split('=')[1])
            cookie_info.update({key:value})
        return cookie_info
